INSERT INTO `plantmail` (`Id`, `Denominacion`, `Cuando_Usa`, `Texto`) VALUES 
(1, 'Confirmación de Pedido', 4, 'Estimado /*usuario*/:\r\n \r\n  Tenemos el agrado de dirgirnos a usted con la finalidad de solicitarle tenga a bien confirmar los datos cargados en el pedido /*pedido*/, el cual no ha podido ser hallado en las respectivas consultas a Bases de Datos que hemos realizado. \r\n\r\nEl problema presentado en relación al mismo se describe a continuación:\r\n\r\n/*problema*/\r\n\r\n  Recuerde por favor acceder al sitio /*sitio*/ en la opción Sitio de Usuarios y allí buscar en la opción Pedidos para confirmar. \r\n\r\nSin mas, lo saluda atentamente.\r\n\r\nPersonal de Búsqueda en BDD \r\nISTEC-PrEBi On-Line\r\nUNLP'),
(2, 'Recepción de Pedido', 6, 'Estimado Usuario /*usuario*/:\r\n\r\n  Tenemos el agrado de dirigirnos a usted con la finalidad de avisarle que su pedido con descripción:  \r\n\r\n/*pedido*/\r\n\r\n /*cita*/\r\n\r\nha sido recibido. El mismo puede ser retirado en las oficinas del PrEBi en el horario de 13 a 18.00 hs.\r\n\r\n  Sin más, lo saluda atentamente,\r\n\r\nPersonal ISTEC-PreBi'),
(3, 'Bienvenido al PrEBi!!!', 100, 'Estimado /*usuario*/:\r\n\r\nPor la presente cumplo en informarle que ha sido dado de alta como Usuario del Proyecto de Enlace de Bibliotecas. A partir de este momento podrá realizar sus solicitudes de "Búsqueda"\r\ndel material bibliográfico que Usted necesite, directamente a través de nuestra página web:\r\nhttp://www.unlp.istec.org/prebi/\r\n\r\nIngrese al Sitio de Usuario cliqueando  este item en la parte superior de la pantalla de su explorador, despues de hacerlo deberá completar la siguiente información:\r\n\r\n  Su login es: /*login*/\r\n  Su clave es: /*password*/\r\n\r\nA partir de este momento se encuentra en su "sitio personal"  del PrEBi.\r\n\r\nPor favor cambie su password a posteriori de ingresar  al sitio para respetar las normativas de seguridad del mismo. Para  cambiar su clave seleccione Cambiar Clave de acceso y modifique los datos, según su comodidad.\r\n\r\nEntre las ventajas de este sistema podemos mencionar que el usuario cuenta con la  información en tiempo real de todo lo que ocurrre con sus solicitudes en curso y un registro histórico relacionado con todas sus solicitudes a lo largo del tiempo de utilización del servicio.                                      \r\nPor medio de la Opción Pedido Nuevo, usted puede llenar el formulario para solicitar un Pedido Nuevo sin necesidad de escribirnos un email. Esta modalidad acelera el proceso de búsqueda.\r\n\r\nPara retirar los pedidos personalmente, nuestra direccion es Calle 49 y 115 (frente al departamento de Fisica)  el edificio construído para que funcionara  el Liceo y en el que  finalmente funcionan aulas y secretarias de Informatica e Ingenieria. \r\nNuestro lugar de trabajo es en el primer piso pasando la Secretaria de Fisicomatematica\r\nde la Facultad de Ingenieria.\r\n\r\n  Atentamente,\r\n  \r\n  Prof. Ing. Marisa De Giusti\r\n  Directora PrEBi-SeDiCI'),
(4, 'Alta de Usuario no UNLP', 101, 'Estimado /*usuario*/:\r\n\r\n  Hemos detectado que ud. no pertenece a la UNLP. Por favor, comuníquese con la directora del servicio al siguente email:\r\n\r\nIng. Marisa De Giusti\r\nmarisa.degiusti@ing.unlp.edu.ar\r\n\r\nDisculpe las molestias.\r\nMuchas Gracias por su interés en nuestros servicios.'),
(5, 'Información para posibles usuario de la UNLP', 100, 'Estimado /*usuario*/:\r\n\r\nLe escribo para comentarle cómo es el servicio:\r\n\r\nUd podrá elegir una de las dos modalidades de trabajado que le\r\nofrecemos:\r\n\r\na. Recepción del archivo .pdf\r\nb. Retirarlo de nuestras oficinas impreso.\r\n\r\n Usted puede solicitarnos capítulos de libros, artículos de revistas,\r\nactas de congresos, patentes, etc. Disponemos de un amplio catálogo que\r\ngarantiza un 90 % de efectividad en la provisión de las solicitudes.\r\n\r\nSi tiene alguna otra duda, no deje de escribirnos.\r\n\r\nSaludos\r\n\r\nPrebi'),
(6, 'no es de UNLP', 101, 'Estimado docente/investigador:\r\n\r\nLamentablemente no podemos en este momento darle el alta para el servicio de obtención de material bibliográfico de la Universidad Nacional de La Plata puesto que los costos del mismo son asumidos por esta misma. \r\nSiempre está en evaluación la posibilidad de ofrecer este servicio a distintas Universidades de país de alguna manera. En caso de tener Usted interés a nivel Institucional o especial interés personal por la obtención de documentos, puede contactarse con la Ing. Marisa De Giusti (marisadg@volta.ing.unlp.edu.ar), Directora del Proyecto quien pondrá a consideración su acceso al servicio.\r\nEstamos muy agradecidos por el interés que ha demostrado.\r\n\r\nAtte.\r\n\r\nPersonal del PrEBi\r\nUNLP\r\n'),
(7, 'Cancelación de solicitud de bibliografía', 8, 'Estimado Usuario /*usuario*/:\r\n\r\n  Me dirijo a ud. para informarle que lamentablemente no hemos ubicado su solicitud de:\r\n\r\n /*cita*/\r\n\r\nLo sentimos mucho.\r\nHasta pronto.\r\n\r\n\r\nPersonal PreBi'),
(8, 'Reconfirmacion de los pedidos encontrados', 102, 'Estimado/a NOMBRE Y APELLIDO,\r\n\r\n  Nos dirigimos a Usted dado que se registra en nuestra Base de Datos que posee /*numero_pedidos*/ pedido(s) solicitado(s) sin retirar de nuestras oficinas.\r\n\r\n  Le rogamos efectuar tal diligencia los días hábiles en el horario de 13 a 18 hs. Sin embargo, si usted lo desea, le ofrecemos acercar los pedidos personalmente. En caso de que así lo desee, informenos por medio de un mail. \r\n\r\nPersonal del PREBI\r\n'),
(9, 'Documento listo para descargar', 12, 'Estimado /*usuario*/\r\n\r\nLe informo a Ud. que su solicitud /*pedido*/\r\n\r\n/*cita*/ \r\nha sido recibido.\r\n\r\nUsted puede encontratrlo en su SITIO DE USUARIOS en la página web del PrEBi  http://www.unlp.istec.org/prebi/\r\n\r\nRecuerde que puede bajar el artículo sólo UNA vez.\r\n\r\nSi tiene inconvenientes por favor contáctenos a bibistec@ing.unlp.edu.ar\r\n\r\nAtte.\r\n\r\nPersonal del PrEBi');
