INSERT INTO `sugerencias` (`Id`, `Titulo`, `Comentario`) VALUES 
(1, 'De qué modo puede ayudarnos el Usuario para agilizar las búsquedas?', 'Resulta de gran importancia que el\r\nUsuario nos envíe TODOS los datos\r\ncon los que cuenta relativos a su solicitud. El tiempo invertido en adicionar autores, títulos de artículos, etc., redunda en beneficio ya que acelera la localización.'),
(2, 'Cuando debo registrar un pedido?', 'Cuando se han agotado las posibilidades de búsqueda en las bibliotecas de la UNLP. Nuestro personal se haya capacitado para encontrar su solicitud en las Bibliotecas cooperantes en ISTEC.');
